from typing import Any, List, Optional, Tuple, Union

from kittycad.api.orgs import update_org_saml_idp
from kittycad.client import ClientFromEnv
from kittycad.models import Error, SamlIdentityProvider
from kittycad.models.base64data import Base64Data
from kittycad.models.idp_metadata_source import (
    IdpMetadataSource,
    OptionBase64EncodedXml,
)
from kittycad.models.saml_identity_provider_create import (
    SamlIdentityProviderCreate,
)
from kittycad.types import Response


def example_update_org_saml_idp():
    # Create our client.
    client = ClientFromEnv()

    result: Optional[Union[SamlIdentityProvider, Error]] = (
        update_org_saml_idp.sync(
            client=client,
            body=SamlIdentityProviderCreate(
                idp_entity_id="<string>",
                idp_metadata_source=IdpMetadataSource(
                    OptionBase64EncodedXml(
                        data=Base64Data(b"<bytes>"),
                    )
                ),
                technical_contact_email="<string>",
            ),
        )
    )

    if isinstance(result, Error) or result is None:
        print(result)
        raise Exception("Error in response")

    body: SamlIdentityProvider = result
    print(body)

